import React from "react";
import Header from "./components/Header";
import Footer from "./components/Footer";
import Items from "./components/Items";


class App extends React.Component {
  constructor(props) {
    super(props)
    this.state = {
      cameras: [
        {
          id: 1,
          title: 'Камера вестибюля',
          img:'camera.jpeg',
          desc: 'AUF',
          type: 'IP-камера',
          resolution: '1080p',
          location: 'Вестибюль',
          price: '199,99'
        },
        {
          id: 2,
          title: 'Камера периметра',
          img:'camera.jpeg',
          desc: 'AUF',
          type: 'Уличная камера',
          resolution: '4K',
          location: 'Периметр здания',
          price: '349,99'
        },
        // Добавьте другие камеры по необходимости
      ]
    }

  }
  render(){
  return (
    <div className="wrapper">
      <Header />
      <Items items= {this.state.items}/>
      <Footer />
    </div>
  );
}
}

export default App;
